    gdjs.FabulaCode.GD_951060_951072_951073_951091_951083_951099Objects1[i].getBehavior("Text").setText("Фабула нарушения по ст. 12.20 КоАП РФ – «Двигался в темное время суток без ближнего или дальнего света фар». \n\nУправлял автомобилем «Ваз» г/н А777АА77, нарушил правила пользования внешними световыми приборами, двигался в темное время суток с выключенным ближним и дальним светом фар. \n\nТем самым нарушил п. 19.1 ПДД РФ. \n\nШтраф: предупреждение или 500 рублей. Рассматривает: инспектор ДПС \n\nПримечание: Согласно п. 1.2 ПДД РФ Темное время суток - промежуток времени от конца вечерних сумерек до начала утренних сумерек.");
