    gdjs.FabulaCode.GD_951060_951072_951073_951091_951083_951099Objects1[i].getBehavior("Text").setText("Фабула ч. 1 ст. 12.27 КоАП РФ – «Не выставил знак аварийной остановки (не включил аварийную сигнализацию) после ДТП» \n\nНе выполнил обязанности, предусмотренные ПДД РФ, в связи с дорожно-транспортным происшествием, участником которого он являлся, управляя автомобилем «Ваз» г/н А777АА77. После дорожно-транспортного происшествия не выставил знак аварийной остановки (не включил аварийную сигнализацию) в соответствии с требованиями ПДД РФ. \n\nТем самым нарушил п.2.5, 7.2 ПДД РФ \n\nШтраф: 1000 рублей Рассматривает: командир роты и выше, начальник ОГИБДД \n\nПримечание: По прибытии на ДТП сразу зафиксировать факт нарушения видеофиксацией");
